(()=>{"use strict";const s=[];new class{constructor(){this.members=new Set}add(s){const e=new Error("Такой персонаж уже существует");if(0!==this.members.size)for(const r of this.members){if(r.name===s.name)throw e;this.members.add(s)}return this.members.add(s),this.members}addAll(...s){for(const e of s)this.members.add(e);return this.members}toArray(){return this.members.forEach((e=>s.push(e))),s}},new class{constructor(s){this.name=s}}("Маг")})();